import { AxiosResponse } from "axios";
import $api from "../http";
import { IProfile } from "../models/IProfile";

export default class ProfileService {
    static fetchProfiles(userId: string): Promise<AxiosResponse<IProfile>> {
        return $api.get<IProfile>(`/profile/${userId}`);
    }
    
    static updateProfiles(userId: string, profileData: Partial<IProfile>): Promise<AxiosResponse<IProfile>> {
        return $api.put<IProfile>(`/profile/${userId}`, profileData);
    }
    
    static createProfiles(profileData: Partial<IProfile>): Promise<AxiosResponse<IProfile>> {
        return $api.post<IProfile>('/profile', profileData);
    }
    
    static deleteProfiles(userId: string): Promise<AxiosResponse<void>> {
        return $api.delete<void>(`/profile/${userId}`);
    }
}
